```ts
// code.ts
async function insertBase64Image(base64Png: string) {
  const bytes = Uint8Array.from(atob(base64Png), (c) => c.charCodeAt(0));
  const image = figma.createImage(bytes);

  const rect = figma.createRectangle();
  rect.resize(300, 300);
  rect.fills = [
    {
      type: "IMAGE",
      imageHash: image.hash,
      scaleMode: "FILL",
    },
  ];

  figma.currentPage.appendChild(rect);
  rect.x = figma.viewport.center.x - rect.width / 2;
  rect.y = figma.viewport.center.y - rect.height / 2;

  figma.viewport.scrollAndZoomIntoView([rect]);
}
```

Notes:
- Pass the raw base64 data (no `data:image/png;base64,` prefix), or strip it before decoding.
- Use `figma.createImage(bytes)` and set a paint with `type: "IMAGE"` and `imageHash`.
- If you want to preserve aspect ratio, use `scaleMode: "FIT"` and size the rectangle accordingly.

